import styles from '../Common.module.css';

function Number(){
    return (
        <div className = {styles.numbercontainer}>
            <div>
              <P>456</P>
              <p>VISITORS</p>
            </div>
            <div>
               <h1>78</h1>
               <h4>YEARS OF HISTORY</h4>
            </div>
            <div>
                 <h1>220</h1>
                 <h4>SQUARE FEET AREA</h4>

            </div>
        </div>
    );
}

export default Number;
